import React from "react";
import "./Recommended.css";
import Avatar from "@material-ui/core/Avatar";

function VideoCard({ image, title, channel, views, timestamp, avatar }) {
  return (
    <div>
      <img src={image} alt="" />
    </div>
  );
}

export default VideoCard;
